import React, {Component} from "react"
import NavBar from "./NavBar";
import Stages from "./Stages";

export default class Documents extends Component {
    render() {
        return(
            <div>
                <NavBar />
                <Stages/>
                <h1>Documents</h1>
          </div>
        )
    }
}
